class ListNode:
	def __init__(self, x):
		self.val = x
		self.next = None

def quickSort(head):
	if head == None:
		return (None, None)

	lHead = lTail = rHead = rTail = None
	p = head.next
	while p != None:
		if p.val < head.val:
			if lHead == None:
				lHead = p
				lTail = p
			else:
				lTail.next = p
				lTail = p
		else:
			if rHead == None:
				rHead = p
				rTail = p
			else:
				rTail.next = p
				rTail = p
		t = p
		p = p.next
		t.next = None # get the head from the old link, and make its next point to None

	(lHead, lTail) = quickSort(lHead)
	(rHead, rTail) = quickSort(rHead)

	if lHead == None and rHead == None:
		tail = head # point the head and tail to the only one
	elif lHead == None and rHead != None:
		head.next = rHead
		tail = rTail
	elif lHead != None and rHead == None:
		tail = head
		head.next = None # point the last's next to None
		lTail.next = head
		head = lHead
	else:
		lTail.next = head
		head.next = rHead
		head = lHead
		tail = rTail

	return (head, tail)

def sortList(head):
	(head,tail) = quickSort(head)
	return head

